import React from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";
import { EventResponse } from "../../../requests/eventTypes";

type Props = {
  event: EventResponse;
};

const EventCard = ({ event }: Props) => {
  return (
    <Card>
      <CardTitle>{event.eventName}</CardTitle>
      <CardSubtitle>{event.eventDate}</CardSubtitle>
      <CardText>
        Attendance: {event.attendees} / {event.rsvps}{" "}
      </CardText>
    </Card>
  );
};

export default EventCard;
